import React, { Component } from "react";
import logo from "../images/logo.svg";
import "./css/Preloader.css";

// console.log(logo);

class Preloader extends Component {
  render() {
    return (
      <div className="loader">



        <div className="logo">
          <svg
            id="Camada_1"
            data-name="Camada 1"
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 400 400"
          >
            <defs />
            <polygon
              className="cls-1"
              points="170.1 103.39 141.57 245.61 107.53 259.35 159.06 29.32 227.7 148.49 305.35 29.32 390 251.06 356.42 242.32 298.91 90.05 242.78 174.7 357.8 370.68 10 281.43 57.21 262.22 297.99 327.43 170.1 103.39"
            />
          </svg>
        </div>




        {/* <img src={logo} alt="logo" /> */}
        <p>Loaging...</p>
      </div>
    );
  }
}

export default Preloader;
